//==============================================================================
void LastFmButton::paint (Graphics& g)
{
    if (currentLastFm.isConnected())
    {
        g.setColour (Colours::black);
        g.drawImage (cachedImage_rectRed_png,
                     0, 0, getWidth()-75, getHeight(),
                     0, 0, cachedImage_rectRed_png.getWidth(), cachedImage_rectRed_png.getHeight());
        
        g.setFont (Font (15.0000f, Font::plain));
        g.drawText (currentLastFm.getUserName(),
                    35, 0, 75, getHeight(),
                    Justification::centred, true);
    }
    else
    {
        g.setColour (Colours::black);
        g.drawImage (cachedImage_rectBlack_png,
                     0, 0, getWidth()-75, getHeight(),
                     0, 0, cachedImage_rectBlack_png.getWidth(), cachedImage_rectBlack_png.getHeight());
    }
}

void LastFmButton::mouseDown(const MouseEvent& e)
{
    if (! currentLastFm.getEnabled().getValue()) {
        currentLastFm.getEnabled().setValue(true);
    }
    else
    {
        //popup info on currently playing song
        currentLastFm.sendNowPlaying(tablePlayingRow);
    }
}

